MAIN PROC FAR
	
	                                 mov                  ax, @data
	                                 mov                  DS, ax
	                                 mov                  ES,ax

	;open graphics mode
	                                 mov                  ax, 0013h
	                                 INT                  10h

	;Initial Screen
	                                 CALL                 initial_screen

	;Initial Conditions
	InitialConditions:               CALL                 Initial_Conditions
									
	;Game Loop
	MainLoop:                                                                                                          	;Call        MovePlayer1
	                                 Call                 MovePlayer1
	                                 Call                 MovePlayer2
	                                 Call                 MoveBall
	                                 CALL                 DrawScores
	                                 ClearBuffer
	                                 Delay                0,25000
	                                 cmp                  Exit,0
	                                 jnz                  EndGame
	                                 cmp                  PointFinished,0
	                                 jz                   MainLoop
	                                 CALL                 Initial_Conditions
	                                 mov                  PointFinished,0
	                                 JMP                  InitialConditions

	;Final Screen
	EndGame:                         CALL                 final_screen

	;end program
	                                 mov                  ah,4
	                                 int                  21h
MAIN ENDP

