CheckBallPlayer1Collision Proc Near
	;ball is to the left of player right bound
	                                 mov                  bx, Player1_X
	                                 add                  bx, Player1Width
	                                 cmp                  bx, Ball_X
	                                 JLE                  NoCollision1

	;ball is to the right of player left side
	                                 mov                  bx, Ballsize
	                                 add                  bx, Ball_X
	                                 cmp                  bx, Player1_X
	                                 JLE                  NoCollision1

	;ball is beneath player upper side
	                                 mov                  bx, Player1_Y
	                                 add                  bx, Player1Height
	                                 cmp                  bx, Ball_Y
	                                 JLE                  NoCollision1

	;ball is above player lower side
	                                 mov                  bx, Ball_Y
	                                 add                  bx, Ballsize
	                                 cmp                  bx, Player1_Y
	                                 JLE                  NoCollision1

	;TRUE
	                                 mov                  AX, 1

	NoCollision1:                    
	                                 RET
CheckBallPlayer1Collision endp

	;__________________________________________________________________
	;______________________________PROC BREAK__________________________
	;__________________________________________________________________

CheckBallPlayer2Collision Proc Near
	;ball is to the left of player right bound
	                                 mov                  bx, Player2_X
	                                 add                  bx, Player2Width
	                                 cmp                  bx, Ball_X
	                                 JLE                  NoCollision2

	;ball is to the right of player left side
	                                 mov                  bx, Ballsize
	                                 add                  bx, Ball_X
	                                 cmp                  bx, Player2_X
	                                 JLE                  NoCollision2

	;ball is beneath player upper side
	                                 mov                  bx, Player2_Y
	                                 add                  bx, Player2Height
	                                 cmp                  bx, Ball_Y
	                                 JLE                  NoCollision2

	;ball is above player lower side
	                                 mov                  bx, Ball_Y
	                                 add                  bx, Ballsize
	                                 cmp                  bx, Player2_Y
	                                 JLE                  NoCollision2

	;TRUE
	                                 mov                  AX, 1

	NoCollision2:                    
	                                 RET
CheckBallPlayer2Collision endp

