dddd proc
	                                 push                 ax
	                                 push                 bx
	                                 push                 cx
	                                 push                 dx
	                                 delay                0,1
	                                 pop                  dx
	                                 pop                  cx
	                                 pop                  bx
	                                 pop                  ax
	                                 RET
dddd endp

